import Header from "../components/Header/Header";
import OfferSection from "../components/OfferSection/OfferSection";
import RoomSection from "../components/RoomSection/RoomSection";
import PeopleCommentsSection from "../components/PeopleCommentsSection/PeopleCommentsSection";
import BookingSection from "../components/BookingSection/BookingSection";
import UpperTownSection from "../components/UpperTownSection/UpperTownSection";
import DiscountSection from "../components/DiscountSection/DiscountSection";
import "./Homepage.css";
const Homepage = () => {
  return (
    <div className="homepage">
      <Header />
      <div className="hero-image-overlay">
        <img className="image-9-icon" alt="" src="/image-9@2x.png" />
        <div className="hero-image-overlay-child" />
        <div className="escape-to-a">Your hideaway in Zagreb!</div>
        <button className="book-your-stay-wrapper">
          <div className="book-your-stay">Book your stay</div>
        </button>
      </div>
      <OfferSection />
      <RoomSection />
      <PeopleCommentsSection />
      <BookingSection />
      <UpperTownSection />
      <DiscountSection />
      <div className="homepage-inner">
        <div className="experience-unparalleled-comfor-parent">
          <div className="experience-unparalleled-comfor">
            Experience unparalleled comfort and luxury with us.
          </div>
          <div className="indulge-in-the">
            Indulge in the epitome of unparalleled comfort and luxury at Hotel
            PARK 45, meticulously crafted to be your perfect urban retreat
            nestled in the vibrant heart of Zagreb, where exceptional
            experiences await you
          </div>
        </div>
      </div>
    </div>
  );
};

export default Homepage;
